#include "PluginProcessor.h"
#include "PluginEditor.h"

AudioPluginAudioProcessorEditor::AudioPluginAudioProcessorEditor (AudioPluginAudioProcessor& p)
        : AudioProcessorEditor (&p), audioProcessor (p)
{
    setLookAndFeel(&customLookAndFeel);


    // Initialize and add sliders
    addAndMakeVisible(inputSlider);
    inputSlider.setSliderStyle(juce::Slider::Rotary);
    inputSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    inputSlider.setRange(0.0f, 1.0f, 0.01f);
    inputSlider.setValue(static_cast<float>(*audioProcessor.getParameters().getRawParameterValue("inputGain")));
    inputSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("inputGain") = static_cast<float>(inputSlider.getValue()); };

    addAndMakeVisible(outputSlider);
    outputSlider.setSliderStyle(juce::Slider::Rotary);
    outputSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    outputSlider.setRange(0.0f, 1.0f, 0.01f);
    outputSlider.setValue(1.0f); // Set output gain to full by default
    outputSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("outputGain") = static_cast<float>(outputSlider.getValue()); };

    addAndMakeVisible(attackSlider);
    attackSlider.setSliderStyle(juce::Slider::Rotary);
    attackSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    attackSlider.setRange(0.0002f, 0.02f, 0.0001f);
    attackSlider.setValue(static_cast<float>(*audioProcessor.getParameters().getRawParameterValue("attack")));
    attackSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("attack") = static_cast<float>(attackSlider.getValue()); };

    addAndMakeVisible(releaseSlider);
    releaseSlider.setSliderStyle(juce::Slider::Rotary);
    releaseSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    releaseSlider.setRange(0.05f, 1.1f, 0.01f);
    releaseSlider.setValue(static_cast<float>(*audioProcessor.getParameters().getRawParameterValue("release")));
    releaseSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("release") = static_cast<float>(releaseSlider.getValue()); };

    addAndMakeVisible(ratioSlider);
    ratioSlider.setSliderStyle(juce::Slider::Rotary);
    ratioSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    ratioSlider.setRange(0, 3, 1); // 4 settings
    ratioSlider.setValue(static_cast<int>(*audioProcessor.getParameters().getRawParameterValue("ratio")));
    ratioSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("ratio") = static_cast<int>(ratioSlider.getValue()); };

    addAndMakeVisible(slamButton);
    slamButton.setButtonText("Slam");
    slamButton.onClick = [this] {
        bool slamState = audioProcessor.isSlamModeOn();
        audioProcessor.setSlamMode(!slamState);
        slamButton.setToggleState(!slamState, juce::dontSendNotification);
    };

    addAndMakeVisible(powerSlider);
    powerSlider.setSliderStyle(juce::Slider::Rotary);
    powerSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    powerSlider.setRange(0, 1, 1); // 2 settings: on and off
    powerSlider.setValue(static_cast<int>(*audioProcessor.getParameters().getRawParameterValue("power")));
    powerSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("power") = static_cast<int>(powerSlider.getValue()); };

    addAndMakeVisible(bypassSlider);
    bypassSlider.setSliderStyle(juce::Slider::Rotary);
    bypassSlider.setTextBoxStyle(juce::Slider::NoTextBox, false, 0, 0); // No text box
    bypassSlider.setRange(0, 1, 1); // 2 settings: on and off
    bypassSlider.setValue(static_cast<int>(*audioProcessor.getParameters().getRawParameterValue("vuMeter")));
    bypassSlider.onValueChange = [this] { *audioProcessor.getParameters().getRawParameterValue("vuMeter") = static_cast<int>(bypassSlider.getValue()); };

    addAndMakeVisible(vuMeter);

    cachedImage_background_png = juce::ImageCache::getFromMemory (background_png, background_pngSize);

    setSize(1000, 210); // Adjust size to fit the layout

    startTimerHz(30); // Update GUI 30 times per second
}

AudioPluginAudioProcessorEditor::~AudioPluginAudioProcessorEditor() {
    setLookAndFeel(nullptr);
}

//==============================================================================

void AudioPluginAudioProcessorEditor::paint (juce::Graphics& g) {
    g.fillAll (juce::Colours::black);
    g.setColour (juce::Colours::white);

    g.fillAll (juce::Colour (0xff323e44));

    {
        int x = 2, y = 2, width = 1000, height = 200;
        g.setColour (juce::Colours::black);
        g.drawImage (cachedImage_background_png,
                     x, y, width, height,
                     0, 0, cachedImage_background_png.getWidth(), cachedImage_background_png.getHeight());
    }
}

void AudioPluginAudioProcessorEditor::resized() {
    int largeKnobSize = 100;
    int smallKnobSize = 70;

    inputSlider.setBounds (85, 55, largeKnobSize, largeKnobSize);
    outputSlider.setBounds (220, 55, largeKnobSize, largeKnobSize);

    attackSlider.setBounds (370, 20, smallKnobSize, smallKnobSize);
    releaseSlider.setBounds (370, 110, smallKnobSize, smallKnobSize);

    ratioSlider.setBounds (500, 80, smallKnobSize, smallKnobSize);

    slamButton.setBounds (600, 100, 20, 20);

    vuMeter.setBounds (663, 28, 160, 83);

    bypassSlider.setBounds (874, 48, 30, 30);
    powerSlider.setBounds (874, 133, 30, 30);
}

void AudioPluginAudioProcessorEditor::timerCallback() {
    vuMeter.setLevel(audioProcessor.getVuLevel());
}


